import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./Note";
import notes from "../notes";

function newNotes(nodes){
    return <Note
        key = {nodes.key}
        title = {nodes.title}
        content = {nodes.content}
    />
}
function App(){
    return(
        <>
        <Header/>
        {notes.map(newNotes)}
        <Footer/>
        </>
    );
}

export default App;
